document.getElementById('download-pdf').addEventListener('click', function () {
    const element = document.querySelector('.pdf-container');

    const opt = {
        margin: [1.7, 0, 2, 0],
        filename: 'page-content.pdf',
        image: { type: 'jpeg', quality: 0.98 },
        html2canvas: { scale: 2 },
        jsPDF: { unit: 'in', format: 'letter', orientation: 'portrait' },
        pagebreak: { mode: ['avoid-all', 'css', 'legacy'] },
    };

    html2pdf().from(element).set(opt).toPdf().get('pdf').then(function (pdf) {
        const totalPages = pdf.internal.getNumberOfPages();

        // Base64 encoded image
        const base64Logo = "data:image/png;base64,"; // Your Base64 string here

        // Define header properties and spacing
        const newWidth = 2; // New width of the image in inches
        const originalWidth = 2; // Original width of the image in inches
        const originalHeight = 0.75; // Original height of the image in inches
        const newHeight = (originalHeight / originalWidth) * newWidth; // Calculate new height
        const headerHeight = 1; // Height of the header section in inches
        const headerMarginBottom = 1; // Margin below the header in inches

        // Calculate total header height including margin
        const totalHeaderHeight = headerHeight + headerMarginBottom;

        for (let i = 1; i <= totalPages; i++) {
            pdf.setPage(i);

            pdf.setFontSize(10);
            pdf.setTextColor(40);
            pdf.text('Taswer Media Production', 0.5, 0.5);
            pdf.text('P.O Box 24690' + '\n' + '2nd Floor, Bldg. 47 Al malji Building' + '\n' + 'Jawan Street, Al Sadd Doha Qatar' + '\n' + 'Bank Account No.: 0260-101656-001', 0.5, 0.7);

            pdf.addImage(base64Logo, 'JPEG', pdf.internal.pageSize.getWidth() - newWidth - 0.5, 0.5, newWidth, newHeight);

            // Draw footer border line
            const footerY = pdf.internal.pageSize.getHeight() - 1.5; // Adjust footer position
            pdf.setDrawColor(199, 57, 57); // Border color #c73939
            pdf.setLineWidth(0.02); // Line width
            pdf.line(0.5, footerY, pdf.internal.pageSize.getWidth() - 0.5, footerY);

            // Add footer text with increased line spacing
            pdf.setFontSize(10);
            pdf.setTextColor(40); // Text color #c73939

            const lineSpacing = 0.18; // Adjust this value to increase/decrease line spacing

            pdf.text('2nd Floor, Bldg. 47 Al malji Building', 0.5, footerY + 0.3);
            pdf.text('Jawan Street, Al Sadd Doha Qatar', 0.5, footerY + 0.3 + lineSpacing);
            pdf.text('P.O Box 24690', 0.5, footerY + 0.3 + 2 * lineSpacing);

            pdf.text('Phone : +97450933665  -  +97444140714', pdf.internal.pageSize.getWidth() / 2, footerY + 0.3);
            pdf.text('WWW.taswer.live', pdf.internal.pageSize.getWidth() / 2, footerY + 0.3 + lineSpacing);

            // Optionally add icons using base64 images or different drawing techniques
        }
    }).save();
});